import "../AdminPanel.css";

export const UserDetails = ({ onClose, user }) => {
  return (
    <div className="overlay">
      <div className="backdrop" onClick={onClose} />

      <Dialog open={open} onClose={handleClose} onSubmit={onAdd}>
        <DialogTitle>Add Cap</DialogTitle>
        <DialogContent>
          <DialogContentText>
            {add ? add : " Add your Cap-Name, Cap-Image and Price"}
            {error ? error : null}
          </DialogContentText>

          <Box
            noValidate
            component="form"
            sx={{
              display: "flex",
              flexDirection: "column",
              m: "auto",
              width: "fit-content",
            }}
          >
            {add ? null : (
              <FormControl sx={{ mt: 2, minWidth: 120 }}>
                <TextField
                  required
                  id="productName"
                  name="productName"
                  label="Cap-Name"
                  value={productName}
                  sx={{ mb: 2 }}
                  onChange={handleInputChange}
                />
                <TextField
                  required
                  id="imageUrl"
                  name="imageUrl"
                  value={imageUrl}
                  label="Image-URL"
                  style={{ width: 400 }}
                  onChange={handleInputChange}
                />
                <TextField
                  id="description"
                  label="Description"
                  name="description"
                  value={description}
                  style={{ width: 400 }}
                  sx={{ mt: 2 }}
                  onChange={handleInputChange}
                />
                <TextField
                  required
                  id="price"
                  label="Price"
                  name="price"
                  value={price}
                  style={{ width: 100 }}
                  sx={{ mt: 2 }}
                  onChange={handleInputChange}
                />
              </FormControl>
            )}
          </Box>
        </DialogContent>
        {add ? null : (
          <DialogActions sx={{ justifyContent: "center", mb: 1 }}>
            <Button variant="outlined" color="inherit" onClick={onAdd}>
              Add
            </Button>
            <Button variant="outlined" color="inherit" onClick={handleClose}>
              Close
            </Button>
          </DialogActions>
        )}
      </Dialog>
    </div>
  );
};

function printAddress(data) {
  return `${data.country}, ${data.city}, ${data.street} ${data.streetNumber}`;
}
